    "Lead and mercury levels in livers of bald eagles recovered in New England",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:48:51.963639",nt"name": "lead-and-mercury-levels-in-livers-of-bald-eagles-recovered-in-new-england",nt"isopen":
    false,nt"url": null,nt"notes": "Between 2001 and 2012, we collected liver
    samples from 127 bald eagles carcasses prior to their transfer to the National Eagle
    Repository. We analyzed liver tissue for lead (Pb) and for mercury (Hg), which is
    another regionally important contaminant. The vast majority of the bald eagles were
    recovered in Maine, but a few were recovered in Massachusetts (5), Connecticut (2)
    and New Hampshire (1). In 127 New England bald eagle livers, 14% had Pb concentrations
    indicative of poisoning (> 30 ppm dry weight). The average Hg level in New England
    bald eagle livers was 13.49 ppm dry weight, which was higher than average levels
    recorded in bald eagles from British Columbia (11.8 ppm), several Great Lake states
    (7.97 ppm), and Alaska (7.10 ppm).",nt"license_title": "License Not Specified",nt"extras":
